const Main = ()=>{
    return(
        <main className={css.main}>
        <div className={css.intro}>
            <div>
                         <h2>A place where you health needs are met</h2>
<p>Our most concern is to make sure how customers get quality and affordable health care.</p>  
            </div>
 <div className={css.cards}></div>
 
            </div>
        
          </main> 
    )
}

export default Main;
